import react from 'react';
import styled from 'styled-components';

export const DownloadSection = styled.div`
    display: block;
`;

export const DownloadContainer = styled.div`
    display: flex;
    position: relative;
`;

export const DownloadTitle = styled.h1`
    color: white;
    font-family: "Cascadia";
    font-weight: bold;
`;
